import {
  Box,
  Text,
  ScrollView,
  Image,
  Heading,
  HStack,
  View,
  Input,
  Pressable,
  VStack,
} from "native-base";
import React, { useState } from "react";
import Colors from "../color";
import Rating from "../Components/Rating";
import { AntDesign, EvilIcons, Ionicons } from "@expo/vector-icons";

function SimiliarProductScreen({ navigation }) {
  const [value, setValue] = useState(0);
  return (
    <Box safeAreaTop flex={1} bg={Colors.white}>
      <HStack
        space={3}
        w="full"
        px={4}
        bg="#FFA500"
        py={3}
        alignItems="center"
        safeAreaTop
      >
        <Pressable onPress={() => navigation.goBack()}>
          <Ionicons name="arrow-back" size={24} color="white" />
        </Pressable>
        <Text bold fontSize={17} color="white">Tin đăng tương tự</Text>
      </HStack>
      <ScrollView px={3} showsVerticalScrollIndicator={false}></ScrollView>
    </Box>
  );
}

export default SimiliarProductScreen;
